
public class Question15b {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=0,j=0;
        while(i<5) {
        	while(j<5) {
        		System.out.print("*");
        		j++;
        	}
        	System.out.println();
        	i++;
        	j=0;
        }
	}

}
